import React from "react";
import './Home.css';
import { Container, Row, Col } from "../../components/Grid";
// import SearchBar from "../../components/SearchBar";

function Home() {

    return (
      <Container fluid>
        <Row>
          <Col size="size md-12">
            <h1 id="header">
Now, more than ever, it’s important to support our local communities. We’ve created a place where you can find the hidden gems in your community and get the basics on their hours and services without the extra fluff. </h1>
            <h2>Have a question for us? Ask away!</h2>
            <p>We’d also love to hear your suggestions on new categories you’d like to see. </p>
          </Col>
          {/* <SearchBar /> */}
      </Row>
     </Container>
      );
    }


export default Home;
